INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "青空の下で謁見", 1, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", 5118061, 0, 0, 7, 40, 8, 2, 91002, 2834);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "未来の騎空団\nマスコット？", 1, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", 5118062, 0, 0, 7, 40, 8, 2, 91002, 2835);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 1, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", 5118063, 0, 0, 7, 40, 8, 2, 91002, 2837);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "黄金色の悩みごと", 1, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", 5118064, 0, 0, 18, 40, 8, 2, 91002, 4108402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "白熱！　格闘大会！", 1, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", 5118065, 0, 0, 18, 40, 8, 2, 91002, 4107402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "オーエド町", "祭り太鼓はオーエドの華", 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", 5118066, 1, 0, 16, 40, 8, 2, 91002, 9000227);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "人気者は遅れて\nやってくる", 1, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", 5118067, 0, 0, 19, 40, 8, 3, 91002, 2101181);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "ランドソル市街地", "巫女・ミーツ・魔法少女", 1, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", 5118068, 0, 0, 18, 40, 8, 3, 91002, 4109402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "ネズ耳は二度なくなる", 1, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", 5118069, 0, 0, 18, 40, 8, 3, 91002, 4305402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "ランドソル市街地", "この出会いにカンパイ！", 1, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", 5118070, 0, 0, 18, 40, 8, 3, 91002, 4101402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "ランドソル市街地", "陰陽アンサンブル", 1, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", 5118071, 0, 0, 18, 40, 8, 3, 91002, 4106402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10118, "フリーマーケット会場", "運試し十番勝負！", 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", 5118072, 1, 0, 7, 40, 8, 3, 91002, 2836);
